import { render } from "@testing-library/react";

// Recebe os parâmetros passadados para o Componenet na variável props
class callback extends Component {
  componentDidMount
  render() {
    return (
        <Card>
          <Row>
            <div>
                <p>Loading...</p>
            </div>
          </Row>
      </Card>
    )
  }
};

export default callback;
